import java.io.*;
import java.util.*;

class ArraySort2nd {
    //Function for sort array
    static void sortit(int[] arr, int n){
        for (int i = 0; i < n; i++){
            arr[i] = i + 1;
        }
    }

    public static void main(String[] args) {
        int[] arr = {10, 7, 9, 2, 8, 3, 5, 4, 6, 1};
        int n = arr.length;

        //For sort an array
        sortit(arr, n);

        //For printing all the element in sorted way
        for (int i = 0; i < n; i++){
            System.out.print(arr[i] + " ");
        }
    }
}

class ArraySort {
    public static void main(String[] args) {
        //Define the original array
        int[] intarray = new int[] {52, 45, 32, 64, 12, 87, 78, 98, 23, 7};
        int temp = 0;

        //Print original array
        System.out.println("Original array: ");
        for(int i = 0; i < intarray.length; i++){
            System.out.print(intarray[i] + " ");
        }

        //Sort the array in ascending order using 2 for loops
        for (int i = 0; i < intarray.length; i++){
            for (int j = i+1; j < intarray.length; j++){
                if(intarray[i] > intarray[j]){
                    temp = intarray[i];
                    intarray[i] = intarray[j];
                    intarray[j] = temp;
                }
            }
        }

        //Print the sorted array
        System.out.println("\nArray sorted in ascending order: ");
        for (int i = 0; i < intarray.length; i++){
            System.out.print(intarray[i] + " ");
        }
    }
}

import java.util.Scanner;

class FindingElement{
    public static void main(String[] args) {
        int n, element, pos, i;
        int[] a = new int[100];
        Scanner sc = new Scanner(System.in);

        System.out.print("Enter array size [1-100]: ");
        n = sc.nextInt();

        System.out.println("Enter array elements: ");
        for (i = 0; i<n; i++){
            a[i] = sc.nextInt();
        }
        
        System.out.println("Enter element to search: ");
        element = sc.nextInt();

        for (pos = 0; pos < n; pos++){
            if(a[pos] == element){
                System.out.printf("%d found at position %d", element, pos+1);
                break;
            }
        }

        if (pos == n){
            System.out.printf("%d not found", element);
        }

        sc.close();
    }
}

import java.util.Scanner;

public class ArrayInput {
    public static void main(String[] args) {
        int n;
        Scanner sc = new Scanner(System.in);
        System.out.print("Enter the number of elements you want to store: ");

        // Reading the number of elements that we want to enter
        n = sc.nextInt();

        // Creates an array in the memory of length 10
        int[] array = new int[10];

        System.out.println("Enter the elements of the array: ");
